import React, { Component } from 'react'

export class ShowInfo extends Component {
  render() {
    return (
      <div className='full-item'>
      <div onClick={() => this.state.onShowInfo(this.props.info)}>{this.props.info.infos}</div>
      </div>
    )
  }
}

export default ShowInfo
